double Tx=0;//目标是base_link前向平移Tx
double Ty=0;//然后左向平移Ty
double Kvx = 0.001;//控制器前后平移比例系数
double Kvy = 0.001;//控制器左右平移比例系数
double eTheld = 0.001;//控制器零位阈值
int FocusRow=30;//关注点的行坐标
int FocusCol=320;//关注点的列坐标
//通过点云中关注点到本体铅锤面的距离测量本体平移实现精准平移控制
